// https://oj.leetcode.com/problems/distinct-subsequences/

#include "Solution.h"

int main()
{
    pair<const char *, const char *> testCases[] = { { "aacaacca", "ca" },
                                                     { "anacondastreetracecar", "contra" },
                                                     { "", "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys" },
                                                     { "ccc", "c" },
                                                     { "b", "b" },
                                                     { "b", "a" },
                                                     { "aabb", "ab" } };
    Solution s;

    for (auto &testCase : testCases)
    {
        s.numDistinct(testCase.first, testCase.second);
    }
}
